import AufgabenListeItem from './AufgabenListeItem'

const AufgabenListe=()=>{
    return (
        <div>
            <h3>Noch zu erledigen</h3>
            <ul>
                <AufgabenListeItem aufgabe={'Kochen'} />
                <AufgabenListeItem aufgabe={'Geschenken besorgen'} />
                <AufgabenListeItem aufgabe={'Geschenken einpacken'} />
                <AufgabenListeItem aufgabe={'Putzen'} />
            </ul>
        </div>
    )
}

export default AufgabenListe;
